import React, { Component } from 'react';
import axios from 'axios';
import './App.css';
import './config.js';

//import components
import Nav from './Components/Nav';
import Search from './Components/Search';
import Gallery from './Components/Gallery';
import NoResults from './Components/NoResults';

export default class App extends React.Component {
  state = {
    pictures: []
  };

  componentDidMount() {
    // axios.get("https://www.flickr.com/services/rest/?method=flickr.photos.search&api_key=d119a484f976b260cc17c2fe2ce18e8f&tags=dogs&auth_token=72157713322643926-d0459381b0b88789&api_sig=8aab49102ce4d84026481cbf641554a3")
    //   .then(response => {
    //     this.setState({
    //       pictures: response.data.photos
    //     })
    //     console.log(response);
    //   })
    //   .catch(error => {
    //     console.log("Error fetching data", error);
    //   })
    fetch("https://www.flickr.com/services/rest/?method=flickr.photos.search&api_key=d119a484f976b260cc17c2fe2ce18e8f&tags=dogs&fformat=json&nojsoncallback=true")
    .then(response => response.json())
    .then(responseData => {
      this.setState({ pictures: responseData.photos });
    })
    .catch(error => {
      console.log("Error fetching data", error);
    });
  }

  render() {
    console.log(this.state.pictures);
    return (
      <div className="container">
        <Search />
        <Nav />
        <Gallery />
        <NoResults /> 
      </div>
    )
  }
};
